// 大雪
const weatherIcon1 = "data:image/png;base64,"
// 大雨
const weatherIcon2 = "data:image/png;base64,"
// 多云
const weatherIcon3 = "data:image/png;base64,"
// 晴
const weatherIcon4 = "data:image/png;base64,"
// 小雪
const weatherIcon5 = "data:image/png;base64,"
// 小雨
const weatherIcon6 = "data:image/png;base64,"
// 阴
const weatherIcon7 = "data:image/png;base64,"
// 中雪
const weatherIcon8 = "data:image/png;base64,"
// 中雨
const weatherIcon9 = "data:image/png;base64,"

export enum weatherType {
  '晴' = 10,
  '多云' = 11,
  '阴' = 12,
  '小雪' = 13,
  '中雪' = 14,
  '大雪' = 15,
  '小雨' = 16,
  '中雨' = 17,
  '大雨' = 18,
}

const weatherIconMap = new Map()
weatherIconMap.set('大雪', weatherIcon1)
weatherIconMap.set('大雨', weatherIcon2)
weatherIconMap.set('多云', weatherIcon3)
weatherIconMap.set('晴', weatherIcon4)
weatherIconMap.set('小雪', weatherIcon5)
weatherIconMap.set('小雨', weatherIcon6)
weatherIconMap.set('阴', weatherIcon7)
weatherIconMap.set('中雪', weatherIcon8)
weatherIconMap.set('中雨', weatherIcon9)

export function getIcon(type: string | number) {
  if (typeof type === 'number') {
    type = weatherType[type]
  }
  if (!isNaN(parseInt(type))) {
    type = weatherType[parseInt(type)]
  }
  return weatherIconMap.get(type) || ''
}
